const NptelContent = ({ onVideoSelect }) => {
  

  return (
    <div className="nptel-container">
        <h2>NPTEL Videos</h2>
        <div className="nptel-videos">
            {/* Map through the videos and display them */}
            {/* Replace the 'video' variable with the actual variable name */}
            {videos.map((video, index) => (
            <div className="nptel-video" key={index}>
                <h3>{video.title}</h3>
                <p>{video.description}</p>
                <button onClick={() => onVideoSelect(video)}>Watch Video</button>
            </div>
            ))}
        </div>
    </div>
  );
};

export default NptelContent;
